1. Begin by sitting comfortably. Close your eyes or focus your sight on a spot in the room.
2. Visualize yourself sitting by a gently flowing stream with leaves floating on the surface of the water.
3. Take each thought that enters your mind and place it on a leaf and let the leaf float by. Do this with each thought regardless of emotions attached and allow it to float by.
4. It's okay if your thoughts stop for a moment; just continue to watch the stream flow at its own pace. No need to speed it up or rush your thoughts along. The idea is not to push the leaves or get rid of your thoughts but to allow them to come and go at their own pace. If a leaf appears to be stuck, do nothing but wait until it is ready to float away.
5. Whenever you feel centered within yourself slowly bring yourself back to the here and now. 

